

const CompressJs = require('compressjs');
const colors = require('colors');





function startTimer() { const t = Date.now(); return { stop: function () { return Date.now() - t } } }

const timer = startTimer();
// Do some work...
const elapsedTime = timer.stop();
console.log(`Elapsed time: ${elapsedTime}ms`);





Number.prototype.toKb = function () { return (this / 1024).toFixed(2) + 'kB'; }

const compressStringToBytes = (str) => {

    let t = startTimer()

    const compressor = CompressJs.Lzp3;
    const data = new Buffer(str, 'utf8');

    const uncompressedSize = data.length;
    const compressed = compressor.compressFile(data);
    const compressedSize = compressed.length;
    const compressionRatio = (compressedSize / uncompressedSize) * 100;

    console.log(` Compressed ║`.bgGreen.black + ` ${compressionRatio.toFixed(2)}% │`.green + ` ${uncompressedSize.toKb()} -> ${compressedSize.toKb()}`.gray + `  \t${timer.stop()}ms`.gray);

    return compressed;
};


const decompressBytesToString = (bytes) => {

    let t = startTimer()

    const compressor = CompressJs.Lzp3;
    console.log("bytes:")
    console.log(bytes)
    const decompressed = compressor.decompressFile(bytes);
    const str = new Buffer(decompressed).toString('utf8');

    const uncompressedSize = bytes.length;
    const compressedSize = decompressed.length;
    const compressionRatio = ((uncompressedSize / compressedSize) * 100) + 100;

    console.log(` Decompressed ║`.bgCyan.black + ` ${compressionRatio.toFixed(2)}% │`.cyan + ` ${uncompressedSize.toKb()} -> ${compressedSize.toKb()}`.gray + `  \t${timer.stop()}ms`.gray);

    return str;
};



